import React from 'react';
import Profile from './Profile';
import Contact from './Contact';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate()

  return (
    <div> 
      <Profile />
      <button onClick={() => navigate('projects/ecommerce')}>
        <div></div>
      </button>
      <Contact />
    </div>
  );
}

export default Home;
